import './App.css';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function kakao(){
    return(
        <Container>
        <Row>
          <Col>1 of 1</Col>
          <Col>1 of 1</Col>
          <Col>1 of 1</Col>
          <Col>1 of 1</Col>
          <Col>1 of 1</Col>
        </Row>
      </Container>
    )
}

export default kakao;
